Description.—Head: Scales on vertex and frontoclypeus brownish gray tipped with pale brownish gray. Outer and inner surfaces of labial palpus brownish gray intermixed with brownish-gray scales tipped with pale brownishgray and pale brownish-gray scales along apical margins of segments 1–2 . Antennal scape pale brownish gray intermixed with brownish-gray scales, pecten brownish gray, flagellum grayish brown gradually brightening apically; first flagellomere in male dilated, inner surface of dilated part with 52 palmate sex scales (n= 1 ), (
Fig. 279
). Proboscis pale brownish gray.

Thorax: Tegula with brownish-gray scales tipped with pale brownish gray; mesonotum with basal 1 / 4 brownish gray, apical 3 / 4 with scales brownish gray tipped with pale brownish gray. Legs brownish gray intermixed with pale brownish-gray scales near midsegments and along apical margins of all segments and tarsomeres. Forewing (
Fig. 322
): Length 4.8–8.9 mm (n = 220 ), brownish gray intermixed with brownish-gray scales tipped with pale brownish gray and pale brownish-gray scales; basal 1 / 3 pale brownish gray except, costa brownish gray; or base dark gradually brightening to 1 / 3 ; submedian fascia complete or incomplete; apical 2 / 3 pale brownish gray or dark at 1 / 3 , brightening to apex; cell with three spots, one near middle, two on apical end along crossvein; marginal spots large and coalescent or small and separate. Undersurface brown. Venation (
Fig. 7
) with M 3 slightly curved; cubital veins divergent from bases with CuA 1 straight and CuA 2 slightly curved. Hindwing: Translucent pale brown. Venation (
Fig. 7
) with crossvein of cell weak, cubitus 4 -branched with all veins arising submarginally from cubitus.
